  .mermaid-main-font {
    font-family: "trebuchet ms", verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);
  }
  .exclude-range {
    fill: ${r.excludeBkgColor};
  }

  .section {
    stroke: none;
    opacity: 0.2;
  }

  .section0 {
    fill: ${r.sectionBkgColor};
  }

  .section2 {
    fill: ${r.sectionBkgColor2};
  }

  .section1,
  .section3 {
    fill: ${r.altSectionBkgColor};
    opacity: 0.2;
  }

  .sectionTitle0 {
    fill: ${r.titleColor};
  }

  .sectionTitle1 {
    fill: ${r.titleColor};
  }

  .sectionTitle2 {
    fill: ${r.titleColor};
  }

  .sectionTitle3 {
    fill: ${r.titleColor};
  }

  .sectionTitle {
    text-anchor: start;
    // font-size: ${r.ganttFontSize};
    // text-height: 14px;
    font-family: 'trebuchet ms', verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);

  }


  /* Grid and axis */

  .grid .tick {
    stroke: ${r.gridColor};
    opacity: 0.8;
    shape-rendering: crispEdges;
    text {
      font-family: ${r.fontFamily};
      fill: ${r.textColor};
    }
  }

  .grid path {
    stroke-width: 0;
  }


  /* Today line */

  .today {
    fill: none;
    stroke: ${r.todayLineColor};
    stroke-width: 2px;
  }


  /* Task styling */

  /* Default task */

  .task {
    stroke-width: 2;
  }

  .taskText {
    text-anchor: middle;
    font-family: 'trebuchet ms', verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);
  }

  // .taskText:not([font-size]) {
  //   font-size: ${r.ganttFontSize};
  // }

  .taskTextOutsideRight {
    fill: ${r.taskTextDarkColor};
    text-anchor: start;
    // font-size: ${r.ganttFontSize};
    font-family: 'trebuchet ms', verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);

  }

  .taskTextOutsideLeft {
    fill: ${r.taskTextDarkColor};
    text-anchor: end;
    // font-size: ${r.ganttFontSize};
  }

  /* Special case clickable */
  .task.clickable {
    cursor: pointer;
  }
  .taskText.clickable {
    cursor: pointer;
    fill: ${r.taskTextClickableColor} !important;
    font-weight: bold;
  }

  .taskTextOutsideLeft.clickable {
    cursor: pointer;
    fill: ${r.taskTextClickableColor} !important;
    font-weight: bold;
  }

  .taskTextOutsideRight.clickable {
    cursor: pointer;
    fill: ${r.taskTextClickableColor} !important;
    font-weight: bold;
  }

  /* Specific task settings for the sections*/

  .taskText0,
  .taskText1,
  .taskText2,
  .taskText3 {
    fill: ${r.taskTextColor};
  }

  .task0,
  .task1,
  .task2,
  .task3 {
    fill: ${r.taskBkgColor};
    stroke: ${r.taskBorderColor};
  }

  .taskTextOutside0,
  .taskTextOutside2
  {
    fill: ${r.taskTextOutsideColor};
  }

  .taskTextOutside1,
  .taskTextOutside3 {
    fill: ${r.taskTextOutsideColor};
  }


  /* Active task */

  .active0,
  .active1,
  .active2,
  .active3 {
    fill: ${r.activeTaskBkgColor};
    stroke: ${r.activeTaskBorderColor};
  }

  .activeText0,
  .activeText1,
  .activeText2,
  .activeText3 {
    fill: ${r.taskTextDarkColor} !important;
  }


  /* Completed task */

  .done0,
  .done1,
  .done2,
  .done3 {
    stroke: ${r.doneTaskBorderColor};
    fill: ${r.doneTaskBkgColor};
    stroke-width: 2;
  }

  .doneText0,
  .doneText1,
  .doneText2,
  .doneText3 {
    fill: ${r.taskTextDarkColor} !important;
  }


  /* Tasks on the critical line */

  .crit0,
  .crit1,
  .crit2,
  .crit3 {
    stroke: ${r.critBorderColor};
    fill: ${r.critBkgColor};
    stroke-width: 2;
  }

  .activeCrit0,
  .activeCrit1,
  .activeCrit2,
  .activeCrit3 {
    stroke: ${r.critBorderColor};
    fill: ${r.activeTaskBkgColor};
    stroke-width: 2;
  }

  .doneCrit0,
  .doneCrit1,
  .doneCrit2,
  .doneCrit3 {
    stroke: ${r.critBorderColor};
    fill: ${r.doneTaskBkgColor};
    stroke-width: 2;
    cursor: pointer;
    shape-rendering: crispEdges;
  }

  .milestone {
    transform: rotate(45deg) scale(0.8,0.8);
  }

  .milestoneText {
    font-style: italic;
  }
  .doneCritText0,
  .doneCritText1,
  .doneCritText2,
  .doneCritText3 {
    fill: ${r.taskTextDarkColor} !important;
  }

  .activeCritText0,
  .activeCritText1,
  .activeCritText2,
  .activeCritText3 {
    fill: ${r.taskTextDarkColor} !important;
  }

  .titleText {
    text-anchor: middle;
    font-size: 18px;
    fill: ${r.textColor}    ;
    font-family: 'trebuchet ms', verdana, arial, sans-serif;
    font-family: var(--mermaid-font-family);
  }

  color: ${r.classText};
}
.edgeLabel .label rect {
  fill: ${r.mainBkg};
}
.label text {
  fill: ${r.classText};
}
.edgeLabel .label span {
  background: ${r.mainBkg};
}

.classTitle {
  font-weight: bolder;
}
.node rect,
  .node circle,
  .node ellipse,
  .node polygon,
  .node path {
    fill: ${r.mainBkg};
    stroke: ${r.nodeBorder};
    stroke-width: 1px;
  }


.divider {
  stroke: ${r.nodeBorder};
  stroke: 1;
}

g.clickable {
  cursor: pointer;
}

g.classGroup rect {
  fill: ${r.mainBkg};
  stroke: ${r.nodeBorder};
}

g.classGroup line {
  stroke: ${r.nodeBorder};
  stroke-width: 1;
}

.classLabel .box {
  stroke: none;
  stroke-width: 0;
  fill: ${r.mainBkg};
  opacity: 0.5;
}

.classLabel .label {
  fill: ${r.nodeBorder};
  font-size: 10px;
}

.relation {
  stroke: ${r.lineColor};
  stroke-width: 1;
  fill: none;
}

.dashed-line{
  stroke-dasharray: 3;
}

.dotted-line{
  stroke-dasharray: 1 2;
}

#compositionStart, .composition {
  fill: ${r.lineColor} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

#compositionEnd, .composition {
  fill: ${r.lineColor} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

#dependencyStart, .dependency {
  fill: ${r.lineColor} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

#dependencyStart, .dependency {
  fill: ${r.lineColor} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

#extensionStart, .extension {
  fill: ${r.mainBkg} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

#extensionEnd, .extension {
  fill: ${r.mainBkg} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

#aggregationStart, .aggregation {
  fill: ${r.mainBkg} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

#aggregationEnd, .aggregation {
  fill: ${r.mainBkg} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

#lollipopStart, .lollipop {
  fill: ${r.mainBkg} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

#lollipopEnd, .lollipop {
  fill: ${r.mainBkg} !important;
  stroke: ${r.lineColor} !important;
  stroke-width: 1;
}

.edgeTerminals {
  font-size: 11px;
}

.classTitleText {
  text-anchor: middle;
  font-size: 18px;
  fill: ${r.textColor};
}
